script: |
  super -f text -I q10663.spq | sort > q10663.out

inputs:
  - name: q10663.spq
    data: |
      SELECT DISTINCT + col0 + col0 FROM tab2 (FORMAT parquet) WHERE NOT ( 68 + + 16 / ( col1 * col0 + + 30 ) ) IS NULL;
  - name: tab2

outputs:
  - name: q10663.out
    data: |
      128
      150
      92
